from collections import defaultdict
class Solution:
    def numSimilarGroups(self, A):
        def dfs(u):
            visited[u]=True
            for v in d[u]:
                if not visited[v]:
                    dfs(v)
        def issame(str1,str2):
            count=0
            for j in range(len(str1)):
                if str1[j]!=str2[j]:
                    count+=1
                    if count>2:
                        return False
            return True
                
        n=len(A)
        if n==0 or len(A[0])==0:
            return 0
        if n==1:
            return 1
        d=defaultdict(list)
        for i in range(n-1):
            for j in range(i+1,n):
                if issame(A[i],A[j]):
                    d[i].append(j)
                    d[j].append(i)
        visited=[False for i in range(n)]
        count=0
        for i in range(n):
            if not visited[i]:
                dfs(i)
                count+=1
        return count
    
class Solution2:
    def numSimilarGroups2(self, A):
        """
        :type A: List[str]
        :rtype: int
        """
        def issame2(group,string):
            for k in range(len(group)):
                count=0
                for j in range(len(string)):
                    if group[k][j]!=string[j]:
                        count+=1
                        if count>2:
                            break
                if count==2:
                    return True
            return False
                
        n=len(A)
        if n==0 or len(A[0])==0:
            return 0
        dp=[[A[0]]]
        for i in range(1,n):
            stack=[]
            for k in range(len(dp)-1,-1,-1):
                if issame2(dp[k],A[i]):
                    temp=dp.pop(k)
                    stack+=temp
                    #dp[k].append(A[i])
            if stack==[]:
                dp.append([A[i]])
            else:
                stack.append(A[i])
                dp.insert(0,stack)
        return len(dp)

